(1, 'CC - Attribution', 'This license lets others distribute, remix, tweak, and build upon your work, even commercially, as long as they credit you for the original creation. This is the most accommodating of licenses offered, in terms of what others can do with your works licensed under Attribution.', 'http://creativecommons.org/licenses/by/3.0', 'A', '2009-02-04 18:14:37', 2, '2009-02-04 18:14:37', 2),
(2, 'CC - Attribution Share Alike', 'This license lets others remix, tweak, and build upon your work even for commercial reasons, as long as they credit you and license their new creations under the identical terms. This license is often compared to open source software licenses. All new works based on yours will carry the same license, so any derivatives will also allow commercial use.', 'http://creativecommons.org/licenses/by-sa/3.0', 'A', '2009-02-04 18:15:17', 2, '2009-02-04 18:15:25', 2),
(3, 'CC - Attribution No Derivatives', 'This license allows for redistribution, commercial and non-commercial, as long as it is passed along unchanged and in whole, with credit to you.', 'http://creativecommons.org/licenses/by-nd/3.0', 'A', '2009-02-04 18:16:03', 2, '2009-02-04 18:16:03', 2),
(4, 'CC - Attribution Non-Commercial', 'This license lets others remix, tweak, and build upon your work non-commercially, and although their new works must also acknowledge you and be non-commercial, they don''t have to license their derivative works on the same terms.', 'http://creativecommons.org/licenses/by-nc/3.0', 'A', '2009-02-04 18:16:42', 2, '2009-02-04 18:18:41', 2),
(5, 'CC - Attribution Non-Commercial Share Alike', 'This license lets others remix, tweak, and build upon your work non-commercially, as long as they credit you and license their new creations under the identical terms. Others can download and redistribute your work just like the by-nc-nd license, but they can also translate, make remixes, and produce new stories based on your work. All new work based on yours will carry the same license, so any derivatives will also be non-commercial in nature.', 'http://creativecommons.org/licenses/by-nc-sa/3.0', 'A', '2009-02-04 18:17:17', 2, '2009-02-04 18:17:17', 2),
(6, 'CC - Attribution Non-Commercial No Derivatives', 'This license is the most restrictive of our six main licenses, allowing redistribution. This license is often called the "free advertising" license because it allows others to download your works and share them with others as long as they mention you and link back to you, but they can''t change them in any way or use them commercially.', 'http://creativecommons.org/licenses/by-nc-nd/3.0', 'A', '2009-02-04 18:18:09', 2, '2009-02-04 18:18:09', 2),
